import React from "react";
import { Box, Stack, Typography, Link } from "@mui/material";

function Navigation() {
  return (
    <Box
      sx={{
        display: "flex",
        textAlign: "center",
        justifyContent: "center",
      }}
    >
      <Stack
        direction={{ xs: "column", sm: "row" }}
        spacing={{ xs: 2, sm: 2, md: 4 }}
      >
        <Link href="#" underline="none">
          {"About"}
        </Link>
        <Link href="#" underline="none">
          {"Photography"}
        </Link>
        <Link href="#" underline="none">
          {"Home"}
        </Link>
      </Stack>
    </Box>
  );
}

export default Navigation;
